import dataclasses
import typing
import datetime


@dataclasses.dataclass
class S3CredentialsDTO:
    aws_access_key_id: str
    aws_session_token: str
    bucket_name: typing.Optional[str]
    cloudfront_domain: typing.Optional[str]
    expiration: datetime.datetime
    folder_name: typing.Optional[str]
    region_name: str
    secret_access_key: str
    protocol: str
    object_acl: str
    url_type: str
